de:
9.30 Uhr: Eröffnung des Geländes ;
? 10 Uhr: Wanderung zur Entdeckung des Feuchtgebiets unter Mitwirkung der FDC, des Vereins "La Faune Landaise" und des Fremdenverkehrsamts von Mimizan;
? 11 Uhr: Hubertusmesse in der Kirche von Aureilhan, gefolgt von einer Vorführung der Treibjagd;
? 12.30 Uhr: Verpflegung vor Ort, angeboten von der ACCA von St Paul en Born
Zahlreiche Jagdverbände, darunter eine Hundeausstellung für Lauf- und Vorstehhunde;
