en:
9 h 30 : Opening of the site ;
? 10 am: Discovery walk of the wetland with the participation of the FDC, the association "La Faune Landaise" and the Tourist Office of Mimizan;
? 11 h : St Hubert?s Day mass in the Church of Aureilhan followed by a demonstration of hunting with hounds;
? 12 h 30 : Catering on the spot proposed by the ACCA of St Paul en Born
