it:
9.30: Apertura del sito;
ore 10: passeggiata alla scoperta della zona umida con la partecipazione della FDC, dell'associazione "La Faune Landaise" e dell'Ufficio del Turismo di Mimizan;
ore 11: Messa del giorno di Sant'Uberto nella chiesa di Aureilhan seguita da una dimostrazione di caccia con i cani da caccia;
ore 12.30: Ristorazione sul posto offerta dall'ACCA di St Paul en Born
Numerose associazioni venatorie, tra cui un'esposizione canina con segugi e cani da punta;
? Vari espositori e attività da scoprire durante la giornata?

fr:
9 h 30 : Ouverture du site ;
• 10 h : Rando découverte de la zone humide avec la participation de la FDC, de l’association « La Faune Landaise » et de l’Office du Tourisme de Mimizan ;
• 11 h : Messe de la St Hubert en l’Église d’Aureilhan suivie d’une démonstration de chasse à courre ;
• 12 h 30 : Restauration sur place proposée par l’ACCA de St Paul en Born
Nombreuses associations cynégétiques dont exposition canine de chiens courant et d’arrêt ;
• Divers exposants et animations à découvrir tout au long de la journée…

nl:
